import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Input">
        <p>
          Upload Image
        </p>
        <button>ADD IMAGE</button>
        <p>
          Upload XML
        </p>
        <button>ADD XML</button>
      </div>
    </div>
  );
}

export default App;
